import {Link} from "react-router-dom";

class Home extends Component {
    render() {
        return (
            <div style={{
                flex: 1, minHeight: '100%', backgroundPosition: 'center',
                backgroundSize: 'cover',
            }}>


                <body>

                <Button variant="primary" >
                    Go to login
                    <Link to={'/login'} className="nav-link"/>
                    </Button>

                </body>


            </div>
        );
    }
}

export default Home;
